import React from "react";
import './Projects.css';
import Header from './Header/Header'
const Projects=()=>{
    return(
        <div className="section-container">
           <Header
                heading='My Projects.'
                details="Here are a few cool things I've worked on, do check them out!"
            />
            </div>
    );
};
export default Projects;
